import logo from './logo.svg';
import './App.css';
import Homepage from "./Components/Homepage";
import LoanApplication from "./Components/LoanApplication"; 

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>

      <main className="Homepage">
        <Homepage />
      </main>

      <div className="LoanApplication">
        <LoanApplication />
      </div>
    </div>
  );
}

export default App;
